import styles from "../styles/Footer.module.css";
import pfpImage from "../images/linkedin.png"; // Adjust the path based on the actual location of pfp.png

const Footer = () => {
  return (
    <div className={styles.all}>
      <p style={{ marginRight: "2%" }}>Let's Connect</p>
      <img width="3%" src={pfpImage} alt="Profile Picture" />
    </div>
  );
};

export { Footer };
